import React from 'react';
import PropTypes from 'prop-types';

/**
 * Flight Results Component
 * Displays a list of flight results
 */
const FlightResults = ({ results }) => {
  return (
    <div className="bg-white rounded shadow">
      <h2 className="text-xl font-semibold p-4 border-b">Flight Results</h2>

      {results.length === 0 ? (
        <div className="p-6 text-center text-gray-500">No results found</div>
      ) : (
        <ul className="divide-y divide-gray-200">
          {results.map(result => (
            <li key={result.id} className="p-4 hover:bg-gray-50 transition-colors">
              <div className="flex flex-col md:flex-row md:items-center justify-between">
                {/* Airline info */}
                <div className="flex items-center space-x-3 mb-2 md:mb-0">
                  <img 
                    src={`/${result.airline}.png`} 
                    alt={result.airlineName}
                    className="w-8 h-8 object-contain"
                    onError={(e) => {
                      e.target.onerror = null;
                      e.target.src = '/favicon.ico'; // Fallback image
                    }}
                  />
                  <span className="font-medium">{result.airlineName}</span>
                </div>

                {/* Route info */}
                <div className="flex items-center space-x-2">
                  <span className="font-bold">{result.departureCode}</span>
                  <svg className="w-4 h-4 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17 8l4 4m0 0l-4 4m4-4H3" />
                  </svg>
                  <span className="font-bold">{result.arrivalCode}</span>
                </div>

                {/* Flight details */}
                <div className="text-sm text-gray-500">
                  <div>Segments: {result.segments}</div>
                  <div>Distance: {typeof result.distance === 'number' ? `${result.distance} km` : result.distance}</div>
                  <div>Duration: {result.duration}</div>
                </div>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

FlightResults.propTypes = {
  results: PropTypes.arrayOf(
    PropTypes.shape({
      id: PropTypes.string.isRequired,
      airline: PropTypes.string.isRequired,
      airlineName: PropTypes.string.isRequired,
      departureCode: PropTypes.string.isRequired,
      arrivalCode: PropTypes.string.isRequired,
      segments: PropTypes.number.isRequired,
      distance: PropTypes.oneOfType([PropTypes.number, PropTypes.string]),
      duration: PropTypes.string
    })
  ).isRequired
};

export default FlightResults;
